// NewIdentityJSONClient creates a JSON client that implements the Identity interface.
// It communicates using JSON and can be configured with a custom HTTPClient.
func NewIdentityJSONClient(addr string, client HTTPClient) Identity {
	prefix := urlBase(addr) + IdentityPathPrefix
	urls := [38]string{
		prefix + "CreateGlobalAccount",
		prefix + "DeleteGlobalAccount",
		prefix + "GetGlobalAccount",
		prefix + "ActivateGlobalAccount",
		prefix + "ResendActivation",
		prefix + "BeginEmailChange",
		prefix + "CompleteEmailChange",
		prefix + "UpdateUsername",
		prefix + "UpdatePassword",
		prefix + "BeginForgotPassword",
		prefix + "CompleteForgotPassword",
		prefix + "SetCommPrefs",
		prefix + "SetPersona",
		prefix + "LinkYoutube",
		prefix + "LinkLitePC",
		prefix + "CreateRelyingPartyLink",
		prefix + "CreateLink",
		prefix + "DestroyLink",
		prefix + "CheckLink",
		prefix + "GetLink",
		prefix + "VerifyPassword",
		prefix + "GetPrevTwitch",
		prefix + "BeginEnableTOTP",
		prefix + "CompleteEnableTOTP",
		prefix + "RegenerateRecoveryTOPTCodes",
		prefix + "SendTOTPCode",
		prefix + "VerifyTOTPCode",
		prefix + "CheckGUIDLinkDelay",
		prefix + "SocialLoginLookup",
		prefix + "SetPrefLang",
		prefix + "MagicLinkGenerate",
		prefix + "MagicLinkValidate",
		prefix + "MagicLinkCheckComplete",
		prefix + "UpdateCreatorCode",
		prefix + "GetCreatorCodes",
		prefix + "GetAccessLogs",
		prefix + "GetPromotions",
		prefix + "ClaimPromoCode",
	}
	if httpClient, ok := client.(*http.Client); ok {
		return &identityJSONClient{
			client: withoutRedirects(httpClient),
			urls:   urls,
		}
	}
	return &identityJSONClient{
		client: client,
		urls:   urls,
	}
}

